import "./BoxRHS.css";
import PatientLogin from "./Login_Reg/PatientLogin";
import Pic from "./LoginImg/Login.jpg"
import { Link } from "react-router-dom";

const BoxRHS = () => {
    return(
        <div className="BoxRHSBody">
            <div>
                <img src={Pic} alt="LoginImage" width="300px" height="300px" id="Login"/>
            </div>
            <div id="BoxRHSLine">                
            </div>
            <div className="LoginDiv">
                <Link to="/DoctorLogin">Are You a DOCTOR</Link>
                <PatientLogin/>
            </div>            
        </div>
    );
}

export default BoxRHS;


